import React, { Component } from 'react'
import {Card, CardBody} from 'reactstrap';

export default class FloatWindow extends Component {
    state = {
        top : 60,
        left : 15
    }

    render() {
        const { top, left } = this.state;
        return (
            <div style={{
                position : 'fixed',
                top,
                left,
                maxWidth : 250
            }} className="float-window">
                <Card onDrag={e => console.log(e)}>
                    <CardBody>
                        <p className="m-0">Test</p>
                    </CardBody>
                </Card>
            </div>
        )
    }
}
